import { useState, useEffect } from "react";

const LANDING_IMAGE = "data:image/jpeg;base64,";

const SENSE_DOORS = [
  { id: "seeing", label: "Seeing", symbol: "" },
  { id: "hearing", label: "Hearing", symbol: "" },
  { id: "smell", label: "Smell", symbol: "" },
  { id: "taste", label: "Taste", symbol: "" },
  { id: "body", label: "Sensation", symbol: "" },
  { id: "mind", label: "Thought", symbol: "" },
];

const VEDANA = [
  { id: "pleasant", label: "Pleasant", color: "#a0d890" },
  { id: "unpleasant", label: "Unpleasant", color: "#d8b090" },
  { id: "neutral", label: "Neutral", color: "#c8c8a0" },
];

const EMOTIONS = [
  "Fear","Grief","Anger","Joy","Love","Restlessness","Dullness",
  "Doubt","Craving","Aversion","Confusion","Peace","Shame","Pride","Not sure",
];

const LIBERATION_NOTES = [
  "Not mine","Passing","Just this","No self here",
  "Sensation only","Already gone","Not me","Empty",
];

const STORM_CYCLE = [
  "Not mine","Unpleasant","Passing","Just sensation","No self",
  "Not mine","Passing","Already gone","Not me","Just this","Unpleasant","Not mine",
];

const RETURN_WORDS = ["return","here","back","breath","return","here"];

export default function NoteIt() {
  const [screen, setScreen] = useState("landing");
  const [darkMode, setDarkMode] = useState(true);
  const [phase, setPhase] = useState("sense");
  const [note, setNote] = useState({});
  const [notes, setNotes] = useState([]);
  const [confirmed, setConfirmed] = useState(null);
  const [anchorPhase, setAnchorPhase] = useState("instruction");
  const [breathCount, setBreathCount] = useState(0);
  const [wanderNote, setWanderNote] = useState({});
  const [wanderPhase, setWanderPhase] = useState("sense");
  const [returnWord, setReturnWord] = useState("return");
  const [pulseExpanded, setPulse] = useState(true);
  const [anchorNotes, setAnchorNotes] = useState([]);
  const [stormIdx, setStormIdx] = useState(0);
  const [stormVis, setStormVis] = useState(true);
  const [stormIntro, setStormIntro] = useState(true);
  const [timerActive, setTimerActive] = useState(false);
  const [timerDuration, setTimerDuration] = useState(10);
  const [timerElapsed, setTimerElapsed] = useState(0);
  const [bellRang, setBellRang] = useState(false);

  const confirm = (t) => { setConfirmed(t); setTimeout(() => setConfirmed(null), 750); };

  const selectSense = (s) => { setNote({ sense: s }); setPhase("vedana"); };
  const selectVedana = (v) => { setNote(p => ({ ...p, vedana: v })); setPhase("emotion"); };
  const finishNote = (emotion = null) => {
    setNotes(p => [...p, { ...note, emotion, time: Date.now() }]);
    confirm("noted");
    setPhase("complete");
    setTimeout(() => { setNote({}); setPhase("sense"); }, 950);
  };

  const noteBreath = (dir) => { setBreathCount(c => c + 1); confirm(dir); setPulse(dir === "in"); };
  const noteWandered = () => { setAnchorPhase("wandered"); setWanderPhase("sense"); setWanderNote({}); };
  const selectWanderSense = (s) => { setWanderNote({ sense: s }); setWanderPhase("vedana"); };
  const finishWander = (v = null) => {
    setAnchorNotes(p => [...p, { ...wanderNote, vedana: v, time: Date.now() }]);
    const w = RETURN_WORDS[Math.floor(Math.random() * RETURN_WORDS.length)];
    setReturnWord(w);
    setAnchorPhase("returning");
    setTimeout(() => { setAnchorPhase("breathing"); setWanderNote({}); setWanderPhase("sense"); }, 2400);
  };

  const startTimer = (mins) => {
    setTimerDuration(mins);
    setTimerElapsed(0);
    setTimerActive(true);
    setBellRang(false);
  };

  const stopTimer = () => {
    setTimerActive(false);
    setTimerElapsed(0);
    setBellRang(false);
  };

  const playBell = () => {
    const audioContext = new (window.AudioContext || window.webkitAudioContext)();
    const osc = audioContext.createOscillator();
    const gain = audioContext.createGain();
    osc.connect(gain);
    gain.connect(audioContext.destination);
    osc.frequency.value = 528;
    gain.gain.setValueAtTime(0.3, audioContext.currentTime);
    gain.gain.exponentialRampToValueAtTime(0.01, audioContext.currentTime + 2);
    osc.start(audioContext.currentTime);
    osc.stop(audioContext.currentTime + 2);
  };

  useEffect(() => {
    if (!timerActive) return;
    const iv = setInterval(() => {
      setTimerElapsed(e => {
        const newElapsed = e + 1;
        if (newElapsed >= timerDuration * 60 && !bellRang) {
          playBell();
          setBellRang(true);
          setTimerActive(false);
        }
        return newElapsed;
      });
    }, 1000);
    return () => clearInterval(iv);
  }, [timerActive, timerDuration, bellRang]);

  useEffect(() => {
    if (screen !== "storm") return;
    const iv = setInterval(() => {
      setStormVis(false);
      setTimeout(() => { setStormIdx(i => (i + 1) % STORM_CYCLE.length); setStormVis(true); }, 280);
    }, 2100);
    return () => clearInterval(iv);
  }, [screen]);

  useEffect(() => {
    if (screen === "anchor" && anchorPhase === "instruction") {
      const timer = setTimeout(() => setAnchorPhase("breathing"), 4000);
      return () => clearTimeout(timer);
    }
  }, [screen, anchorPhase]);

  useEffect(() => {
    if (screen === "storm" && stormIntro) {
      const timer = setTimeout(() => setStormIntro(false), 3500);
      return () => clearTimeout(timer);
    }
    if (screen !== "storm") {
      setStormIntro(true);
    }
  }, [screen, stormIntro]);

  const formatTime = (secs) => {
    const m = Math.floor(secs / 60);
    const s = secs % 60;
    return `${m}:${s.toString().padStart(2, '0')}`;
  };

  const stats = {
    total: notes.length,
    pleasant: notes.filter(n => n.vedana?.id === "pleasant").length,
    unpleasant: notes.filter(n => n.vedana?.id === "unpleasant").length,
    neutral: notes.filter(n => n.vedana?.id === "neutral").length,
  };

  const theme = darkMode ? {
    bg: '#1a1710',
    text: '#e8dcc0',
    textMid: '#c8b890',
    textDim: '#a89870',
    border: '#3a3020',
    borderHi: '#6a5a30',
    surface: '#2a2418',
  } : {
    bg: '#f4f0e8',
    text: '#3a3020',
    textMid: '#5a4a30',
    textDim: '#7a6a50',
    border: '#c8b890',
    borderHi: '#a89870',
    surface: '#e8e0d0',
  };

  const css = `
    @import url('https://fonts.googleapis.com/css2?family=Outfit:wght@200;300;400;600;800&family=Space+Grotesk:wght@300;400&display=swap');
    *,*::before,*::after{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent;}
    html,body{height:100%;background:${theme.bg};color:${theme.text};font-family:'Space Grotesk',sans-serif;-webkit-font-smoothing:antialiased;}
    .wrap{min-height:100vh;display:flex;flex-direction:column;align-items:center;padding:40px 24px 60px;max-width:500px;margin:0 auto;overflow-y:auto;-webkit-overflow-scrolling:touch;touch-action:pan-y;}
    .landing{position:fixed;inset:0;display:flex;align-items:center;justify-content:center;background:#000;}
    .landing-img{width:100%;height:100%;object-fit:contain;}
    .theme-toggle{position:fixed;top:20px;right:20px;z-index:100;background:transparent;border:1px solid ${theme.border};border-radius:50%;width:40px;height:40px;display:flex;align-items:center;justify-content:center;cursor:pointer;touch-action:manipulation;font-size:1.2rem;transition:all .2s;}
    .theme-toggle:active{background:${theme.surface};}
    .mode-switch{position:fixed;bottom:20px;left:50%;transform:translateX(-50%);display:flex;gap:8px;background:${theme.surface};border:1px solid ${theme.border};border-radius:30px;padding:6px;z-index:90;}
    .mode-switch-btn{background:transparent;border:none;padding:8px 14px;border-radius:20px;font-family:'Space Grotesk',sans-serif;font-size:.55rem;letter-spacing:.2em;text-transform:uppercase;color:${theme.textDim};cursor:pointer;touch-action:manipulation;transition:all .2s;font-weight:300;}
    .mode-switch-btn.active{background:${theme.bg};color:${theme.text};}
    .timer-bar{width:100%;padding:12px 16px;background:${theme.surface};border:1px solid ${theme.border};border-radius:6px;margin-bottom:20px;display:flex;justify-content:space-between;align-items:center;}
    .timer-display{font-family:'Outfit',sans-serif;font-size:1rem;font-weight:300;color:${theme.textMid};}
    .timer-btns{display:flex;gap:8px;}
    .timer-btn{background:transparent;border:1px solid ${theme.border};border-radius:4px;padding:6px 12px;font-family:'Space Grotesk',sans-serif;font-size:.5rem;letter-spacing:.2em;text-transform:uppercase;color:${theme.textDim};cursor:pointer;touch-action:manipulation;transition:all .2s;font-weight:300;}
    .timer-btn:active{background:${theme.bg};color:${theme.text};}
    .cfm{position:fixed;inset:0;display:flex;align-items:center;justify-content:center;pointer-events:none;z-index:60;}
    .cfm-t{font-family:'Outfit',sans-serif;font-weight:300;font-size:clamp(2rem,8vw,3.2rem);color:${theme.textMid};letter-spacing:.35em;text-transform:uppercase;animation:fuo .75s ease forwards;}
    @keyframes fuo{0%{opacity:0;transform:translateY(8px)}25%{opacity:1;transform:translateY(0)}100%{opacity:0;transform:translateY(-10px)}}
    .pnav{width:100%;display:flex;justify-content:space-between;align-items:center;margin-bottom:36px;}
    .nb{background:none;border:none;font-family:'Space Grotesk',sans-serif;font-size:.58rem;letter-spacing:.3em;text-transform:uppercase;color:${theme.textMid};cursor:pointer;touch-action:manipulation;padding:8px 0;transition:color .2s;font-weight:300;}
    .nb:active{color:${theme.text};}
    .tally{font-size:.52rem;letter-spacing:.2em;color:${theme.textDim};font-weight:300;}
    .ps{font-size:.5rem;letter-spacing:.55em;text-transform:uppercase;color:${theme.textDim};text-align:center;margin-bottom:14px;width:100%;font-weight:300;}
    .pq{font-family:'Outfit',sans-serif;font-size:clamp(2.2rem,7vw,3rem);font-weight:200;color:${theme.textMid};text-align:center;letter-spacing:.01em;line-height:1.2;margin-bottom:36px;width:100%;}
    .ctx{display:flex;gap:8px;flex-wrap:wrap;margin-bottom:24px;min-height:24px;width:100%;}
    .ctag{font-size:.52rem;letter-spacing:.22em;padding:4px 14px;border:1px solid ${theme.border};border-radius:30px;color:${theme.textMid};text-transform:uppercase;font-weight:300;}
    .sg{display:grid;grid-template-columns:repeat(3,1fr);gap:10px;width:100%;margin-bottom:32px;}
    .sc{aspect-ratio:1;display:flex;flex-direction:column;align-items:center;justify-content:center;gap:10px;background:transparent;border:1px solid ${theme.border};border-radius:6px;cursor:pointer;touch-action:manipulation;transition:all .2s;color:${theme.textMid};}
    .sc:active{background:${theme.surface};border-color:${theme.borderHi};color:${theme.text};}
    .ssym{font-size:1.9rem;line-height:1;}
    .slbl{font-size:.54rem;letter-spacing:.2em;text-transform:uppercase;font-weight:300;}
    .vs{display:flex;flex-direction:column;gap:10px;width:100%;margin-bottom:32px;}
    .vc{width:100%;padding:24px 20px;background:transparent;border:1px solid ${theme.border};border-radius:6px;font-family:'Outfit',sans-serif;font-size:clamp(1.6rem,5vw,2.2rem);font-weight:300;letter-spacing:.04em;cursor:pointer;touch-action:manipulation;transition:all .2s;text-align:left;}
    .eg{display:grid;grid-template-columns:repeat(2,1fr);gap:8px;width:100%;margin-bottom:12px;max-height:320px;overflow-y:auto;-webkit-overflow-scrolling:touch;}
    .ec{padding:15px 10px;background:transparent;border:1px solid ${theme.border};border-radius:6px;color:${theme.textMid};font-family:'Space Grotesk',sans-serif;font-size:.75rem;letter-spacing:.08em;cursor:pointer;touch-action:manipulation;transition:all .2s;text-align:center;font-weight:300;}
    .ec:active{background:${theme.surface};border-color:${theme.borderHi};color:${theme.text};}
    .skip{width:100%;padding:15px;background:none;border:1px solid ${theme.border};border-radius:6px;color:${theme.textDim};font-family:'Space Grotesk',sans-serif;font-size:.56rem;letter-spacing:.28em;text-transform:uppercase;cursor:pointer;touch-action:manipulation;transition:color .2s;font-weight:300;}
    .skip:active{color:${theme.text};}
    .cscreen{width:100%;display:flex;align-items:center;justify-content:center;height:220px;}
    .cword{font-family:'Outfit',sans-serif;font-weight:200;font-size:clamp(2.5rem,10vw,4.5rem);color:${theme.textMid};letter-spacing:.35em;text-transform:uppercase;animation:fuo .95s ease forwards;}
    .lib{width:100%;margin-top:36px;padding-top:24px;border-top:1px solid ${theme.border};}
    .libey{font-size:.48rem;letter-spacing:.45em;text-transform:uppercase;color:${theme.textDim};text-align:center;margin-bottom:14px;font-weight:300;}
    .libg{display:flex;flex-wrap:wrap;gap:8px;justify-content:center;}
    .lb{padding:8px 16px;background:transparent;border:1px solid ${theme.border};border-radius:30px;color:${theme.textMid};font-family:'Space Grotesk',sans-serif;font-size:.64rem;letter-spacing:.1em;cursor:pointer;touch-action:manipulation;transition:all .2s;font-weight:300;}
    .lb:active{color:${theme.text};border-color:${theme.borderHi};background:${theme.surface};}
    .inst-screen{width:100%;display:flex;flex-direction:column;align-items:center;justify-content:center;flex:1;padding:40px 0;}
    .inst-text{font-family:'Outfit',sans-serif;font-weight:200;font-size:clamp(1.6rem,6vw,2.4rem);color:${theme.textMid};text-align:center;line-height:1.5;letter-spacing:.02em;padding:0 20px;animation:fadeOut 4s ease forwards;}
    @keyframes fadeOut{0%{opacity:0}15%{opacity:1}85%{opacity:1}100%{opacity:0}}
    .bcw{position:relative;width:230px;height:230px;margin:14px auto 36px;display:flex;align-items:center;justify-content:center;}
    .br{position:absolute;border-radius:50%;border:1px solid;transition:all 1.9s cubic-bezier(.4,0,.2,1);}
    .bc{position:absolute;border-radius:50%;transition:all 1.9s cubic-bezier(.4,0,.2,1);}
    .blbl{position:relative;z-index:2;font-family:'Outfit',sans-serif;font-weight:200;font-size:1.1rem;color:${theme.textMid};letter-spacing:.45em;text-transform:uppercase;pointer-events:none;}
    .bbtns{display:grid;grid-template-columns:1fr 1fr;gap:12px;width:100%;margin-bottom:14px;}
    .bb{padding:30px 16px;background:transparent;border:1px solid;border-radius:6px;font-family:'Outfit',sans-serif;font-size:clamp(2.2rem,8vw,3rem);font-weight:200;cursor:pointer;touch-action:manipulation;transition:all .2s;text-align:center;letter-spacing:.1em;text-transform:uppercase;}
    .bin{color:#a0d890;border-color:#5a7a48;}
    .bin:active{background:#243020;border-color:#80c070;color:#c0f0b0;}
    .bout{color:#c8c898;border-color:#6a6a48;}
    .bout:active{background:#242408;border-color:#b8b878;color:#e8e8c8;}
    .wb{width:100%;padding:16px;background:transparent;border:1px solid ${theme.border};border-radius:6px;color:${theme.textDim};font-family:'Space Grotesk',sans-serif;font-size:.58rem;letter-spacing:.32em;text-transform:uppercase;cursor:pointer;touch-action:manipulation;transition:all .2s;margin-bottom:14px;font-weight:300;}
    .wb:active{color:${theme.text};border-color:${theme.borderHi};background:${theme.surface};}
    .astats{display:flex;gap:32px;justify-content:center;margin-top:10px;}
    .an{font-family:'Outfit',sans-serif;font-size:2rem;font-weight:200;color:${theme.textMid};display:block;line-height:1;}
    .al{font-size:.44rem;letter-spacing:.28em;text-transform:uppercase;color:${theme.textDim};margin-top:5px;display:block;font-weight:300;}
    .retscreen{width:100%;display:flex;align-items:center;justify-content:center;padding:60px 0;}
    .retword{font-family:'Outfit',sans-serif;font-weight:200;font-size:clamp(3.5rem,14vw,6rem);color:${theme.textMid};letter-spacing:.35em;text-transform:uppercase;animation:gf 2.4s ease forwards;}
    @keyframes gf{0%{opacity:0;transform:scale(.97)}20%{opacity:1;transform:scale(1)}80%{opacity:1}100%{opacity:0;transform:scale(1.02)}}
    .storm-scr{position:fixed;inset:0;background:#110e08;display:flex;flex-direction:column;align-items:center;justify-content:center;padding:40px 24px;z-index:100;overflow-y:auto;-webkit-overflow-scrolling:touch;touch-action:pan-y;}
    .seye{font-size:.48rem;letter-spacing:.55em;text-transform:uppercase;color:#b8a070;margin-bottom:64px;font-weight:300;}
    .storm-intro{font-family:'Outfit',sans-serif;font-weight:200;font-size:clamp(1.4rem,5vw,2rem);color:#a89070;text-align:center;line-height:1.5;letter-spacing:.02em;padding:0 30px;margin-bottom:40px;animation:fadeOut 3.5s ease forwards;}
    .sw{font-family:'Outfit',sans-serif;font-size:clamp(3rem,14vw,6.5rem);font-weight:200;color:#e8b878;text-align:center;letter-spacing:.12em;text-transform:uppercase;line-height:1.1;transition:opacity .28s ease;}
    .sw.fade{opacity:0;}
    .sex{margin-top:80px;padding:15px 32px;background:none;border:1px solid #5a4a28;border-radius:6px;color:#b8a070;font-family:'Space Grotesk',sans-serif;font-size:.54rem;letter-spacing:.32em;text-transform:uppercase;cursor:pointer;touch-action:manipulation;transition:all .2s;font-weight:300;}
    .sex:active{color:#e8d0a0;border-color:#8a6a40;}
  `;

  if (screen === "landing") return (
    <><style>{css}</style>
    <div className="landing">
      <img className="landing-img" src={LANDING_IMAGE} alt="Note it!" onClick={() => setScreen("home")} style={{cursor:'pointer',touchAction:'manipulation'}} />
    </div></>
  );

  const ModeSwitch = () => screen !== "landing" && screen !== "home" && (
    <div className="mode-switch">
      <button className={`mode-switch-btn ${screen==="noting"?"active":""}`} onClick={() => { setScreen("noting"); setPhase("sense"); }}>Note</button>
      <button className={`mode-switch-btn ${screen==="anchor"?"active":""}`} onClick={() => { setScreen("anchor"); setAnchorPhase("instruction"); }}>Anchor</button>
      <button className={`mode-switch-btn ${screen==="storm"?"active":""}`} onClick={() => setScreen("storm")}>Storm</button>
    </div>
  );

  if (screen === "storm") return (
    <><style>{css}</style>
    <div className="storm-scr">
      <div className="seye"> storm mode</div>
      {stormIntro && <div className="storm-intro">Use this when overwhelmed</div>}
      <div className={`sw${stormVis?"":" fade"}`}>{STORM_CYCLE[stormIdx]}</div>
      <button className="sex" onClick={() => setScreen("home")}> return home</button>
    </div>
    <ModeSwitch />
    </>
  );

  if (screen === "anchor") return (
    <><style>{css}</style>
    <button className="theme-toggle" onClick={() => setDarkMode(!darkMode)}>{darkMode?"":""}</button>
    {confirmed && <div className="cfm"><span className="cfm-t">{confirmed}</span></div>}
    <div className="wrap">
      <div className="pnav">
        <button className="nb" onClick={() => { setScreen("home"); setAnchorPhase("instruction"); setBreathCount(0); setAnchorNotes([]); stopTimer(); }}> home</button>
        <span className="tally">{breathCount} breaths  {anchorNotes.length} wanders</span>
        <span />
      </div>

      {!timerActive && (
        <div className="timer-bar">
          <span className="timer-display">Set timer?</span>
          <div className="timer-btns">
            <button className="timer-btn" onClick={() => startTimer(5)}>5min</button>
            <button className="timer-btn" onClick={() => startTimer(10)}>10min</button>
            <button className="timer-btn" onClick={() => startTimer(15)}>15min</button>
            <button className="timer-btn" onClick={() => startTimer(20)}>20min</button>
          </div>
        </div>
      )}

      {timerActive && (
        <div className="timer-bar">
          <span className="timer-display">{formatTime(timerElapsed)} / {timerDuration}min</span>
          <button className="timer-btn" onClick={stopTimer}>Stop</button>
        </div>
      )}

      {anchorPhase === "instruction" && (
        <div className="inst-screen">
          <div className="inst-text">Observe the incoming<br />and outgoing breath.<br />Note it.</div>
        </div>
      )}

      {anchorPhase === "breathing" && <>
        <div className="bcw">
          <div className="br" style={{width:pulseExpanded?"210px":"126px",height:pulseExpanded?"210px":"126px",borderColor:pulseExpanded?"#60a050":"#4a3a20"}}/>
          <div className="br" style={{width:pulseExpanded?"162px":"94px",height:pulseExpanded?"162px":"94px",borderColor:pulseExpanded?"#508a40":"#3a3020",transitionDelay:".12s"}}/>
          <div className="bc" style={{width:pulseExpanded?"100px":"58px",height:pulseExpanded?"100px":"58px",background:pulseExpanded?"radial-gradient(circle,#407030 0%,transparent 70%)":"radial-gradient(circle,#2a2418 0%,transparent 70%)",transitionDelay:".22s"}}/>
          <span className="blbl">{pulseExpanded?"in":"out"}</span>
        </div>
        <div className="bbtns">
          <button className="bb bin" onClick={() => noteBreath("in")}>in</button>
          <button className="bb bout" onClick={() => noteBreath("out")}>out</button>
        </div>
        <button className="wb" onClick={noteWandered}>mind wandered</button>
        <div className="astats">
          <div><span className="an">{breathCount}</span><span className="al">breaths</span></div>
          <div><span className="an">{anchorNotes.length}</span><span className="al">wanders</span></div>
        </div>
      </>}

      {anchorPhase === "wandered" && <>
        <div className="ps">where did it go?</div>
        <div className="pq">{wanderPhase==="sense"?"Which door?":"Feeling tone?"}</div>
        {wanderPhase==="sense" && <div className="sg">
          {SENSE_DOORS.map(s => (
            <button key={s.id} className="sc" onClick={() => selectWanderSense(s)}>
              <span className="ssym">{s.symbol}</span>
              <span className="slbl">{s.label}</span>
            </button>
          ))}
        </div>}
        {wanderPhase==="vedana" && <>
          <div className="ctx">{wanderNote.sense && <span className="ctag">{wanderNote.sense.label}</span>}</div>
          <div className="vs">
            {VEDANA.map(v => (
              <button key={v.id} className="vc" onClick={() => finishWander(v)} style={{color:v.color,borderColor:v.color+"30"}}>{v.label}</button>
            ))}
          </div>
          <button className="skip" onClick={() => finishWander(null)}>skip  return now</button>
        </>}
      </>}

      {anchorPhase === "returning" && (
        <div className="retscreen"><span className="retword">{returnWord}</span></div>
      )}
    </div>
    <ModeSwitch />
    </>
  );

  if (screen === "noting") return (
    <><style>{css}</style>
    <button className="theme-toggle" onClick={() => setDarkMode(!darkMode)}>{darkMode?"":""}</button>
    {confirmed && <div className="cfm"><span className="cfm-t">{confirmed}</span></div>}
    <div className="wrap">
      <div className="pnav">
        <button className="nb" onClick={() => { setScreen("home"); stopTimer(); }}> home</button>
        <span className="tally">{notes.length} noted</span>
        <span />
      </div>

      {!timerActive && (
        <div className="timer-bar">
          <span className="timer-display">Set timer?</span>
          <div className="timer-btns">
            <button className="timer-btn" onClick={() => startTimer(5)}>5min</button>
            <button className="timer-btn" onClick={() => startTimer(10)}>10min</button>
            <button className="timer-btn" onClick={() => startTimer(15)}>15min</button>
            <button className="timer-btn" onClick={() => startTimer(20)}>20min</button>
          </div>
        </div>
      )}

      {timerActive && (
        <div className="timer-bar">
          <span className="timer-display">{formatTime(timerElapsed)} / {timerDuration}min</span>
          <button className="timer-btn" onClick={stopTimer}>Stop</button>
        </div>
      )}

      <div className="ctx">
        {note.sense && <span className="ctag">{note.sense.label}</span>}
        {note.vedana && <span className="ctag" style={{borderColor:note.vedana.color+"50",color:note.vedana.color}}>{note.vedana.label}</span>}
      </div>
      {phase==="sense" && <>
        <div className="ps">01  sense door</div>
        <div className="pq">What is<br/>most prominent?</div>
        <div className="sg">
          {SENSE_DOORS.map(s => (
            <button key={s.id} className="sc" onClick={() => selectSense(s)}>
              <span className="ssym">{s.symbol}</span>
              <span className="slbl">{s.label}</span>
            </button>
          ))}
        </div>
        <div className="lib">
          <div className="libey">liberation notes</div>
          <div className="libg">
            {LIBERATION_NOTES.map(n => <button key={n} className="lb" onClick={() => confirm(n)}>{n}</button>)}
          </div>
        </div>
      </>}
      {phase==="vedana" && <>
        <div className="ps">02  feeling tone</div>
        <div className="pq">Its quality?</div>
        <div className="vs">
          {VEDANA.map(v => (
            <button key={v.id} className="vc" onClick={() => selectVedana(v)} style={{color:v.color,borderColor:v.color+"30"}}>{v.label}</button>
          ))}
        </div>
      </>}
      {phase==="emotion" && <>
        <div className="ps">03  emotion</div>
        <div className="pq">Any emotion<br/>present?</div>
        <div className="eg">
          {EMOTIONS.map(e => <button key={e} className="ec" onClick={() => finishNote(e)}>{e}</button>)}
        </div>
        <button className="skip" onClick={() => finishNote(null)}>no emotion  skip</button>
      </>}
      {phase==="complete" && <div className="cscreen"><span className="cword">noted</span></div>}
    </div>
    <ModeSwitch />
    </>
  );

  return (
    <><style>{css}</style>
    <button className="theme-toggle" onClick={() => setDarkMode(!darkMode)}>{darkMode?"":""}</button>
    <div className="wrap" style={{justifyContent:'center'}}>
      <div style={{width:'100%',display:'flex',flexDirection:'column',gap:'12px'}}>
        <button onClick={() => { setScreen("noting"); setPhase("sense"); setNote({}); }} style={{width:'100%',padding:'24px',background:'transparent',border:`1.5px solid ${theme.borderHi}`,borderRadius:'6px',fontFamily:'Outfit,sans-serif',fontSize:'1.4rem',fontWeight:'300',color:theme.textMid,cursor:'pointer',touchAction:'manipulation',textAlign:'left'}}>
          <div style={{fontSize:'1.4rem',marginBottom:'4px'}}>Noting</div>
          <div style={{fontSize:'.54rem',letterSpacing:'.22em',color:theme.textDim,textTransform:'uppercase',fontWeight:'300'}}>senses  vedana  emotions</div>
        </button>
        <button onClick={() => { setScreen("anchor"); setAnchorPhase("instruction"); setPulse(true); }} style={{width:'100%',padding:'24px',background:'transparent',border:`1.5px solid ${theme.borderHi}`,borderRadius:'6px',fontFamily:'Outfit,sans-serif',fontSize:'1.4rem',fontWeight:'300',color:theme.textMid,cursor:'pointer',touchAction:'manipulation',textAlign:'left'}}>
          <div style={{fontSize:'1.4rem',marginBottom:'4px'}}>Anchor</div>
          <div style={{fontSize:'.54rem',letterSpacing:'.22em',color:theme.textDim,textTransform:'uppercase',fontWeight:'300'}}>breath  in  out  return</div>
        </button>
        <button onClick={() => setScreen("storm")} style={{width:'100%',padding:'24px',background:'transparent',border:`1.5px solid ${theme.borderHi}`,borderRadius:'6px',fontFamily:'Outfit,sans-serif',fontSize:'1.4rem',fontWeight:'300',color:theme.textMid,cursor:'pointer',touchAction:'manipulation',textAlign:'left'}}>
          <div style={{fontSize:'1.4rem',marginBottom:'4px'}}>Storm</div>
          <div style={{fontSize:'.54rem',letterSpacing:'.22em',color:theme.textDim,textTransform:'uppercase',fontWeight:'300'}}>liberation notes  rapid fire</div>
        </button>
      </div>
    </div>
    </>
  );
}
